<!doctype html>
<html lang="en">
<head>
<meta charset="utf-8" />
<meta http-equiv="X-UA-Compatible" content="IE=edge" />
<meta name="viewport" content="width=device-width,initial-scale=1,shrink-to-fit=no,viewport-fit=cover" />
<meta name="theme-color" content="#ffffff" />
<title>30days plank challenge</title>
<link rel="dns-prefetch preconnect" href="//fonts.googleapis.com" />
<link rel="dns-prefetch preconnect" href="//fonts.gstatic.com" />
<link rel="dns-prefetch preconnect" href="//cdnjs.cloudflare.com" />
<link rel="apple-touch-icon" sizes="180x180" href="/apple-touch-icon.png" />
<link rel="icon" type="image/png" sizes="32x32" href="/static/images/favicon-32x32.png" />
<link rel="icon" type="image/png" sizes="16x16" href="/static/images/favicon-16x16.png" />
<link rel="manifest" href="/static/manifest.json" />
<link href="//fonts.googleapis.com/css?family=Roboto+Condensed:400,700|Roboto:400,500&display=swap" rel="preload" as="style" onload="this.onload=null;this.rel='stylesheet'">
<script src="//cdnjs.cloudflare.com/ajax/libs/loadCSS/2.1.0/cssrelpreload.min.js" async></script>
<script>
(function() {
  var b = document.createElement('b');
  b.textContent = 'b';
  b.style.fontWeight = '700';
  b.style.opacity = '0';
  b.style.position = 'absolute';
  document.documentElement.appendChild(b);
  function removeFontLoader() {
    b.remove();
    document.removeEventListener('DOMContentLoaded', removeFontLoader);
  }
  document.addEventListener('DOMContentLoaded', removeFontLoader);
})();
</script>
</head>
<body>
<div id="root"></div>
<div hidden><%= htmlWebpackPlugin.options.svg %></div>
</body>
</html>
